    /**
     * Generate a single-column dataframe from the precomputed matrix
     * 
     * @param col: the column of data to select
     * @return A single-column dataframe
     */
    public static Dataframe generate(int col) {
        List<PredictionInput> ps = new ArrayList<>();
        for (int i = 0; i < data[0].length; i++) {
            ps.add(new PredictionInput(List.of(FeatureFactory.newNumericalFeature(String.valueOf(i), data[col][i]))));
        }
        return Dataframe.createFromInputs(ps);
    }

    /**
     * Generate an n-column dataframe from the precomputed matrix
     * 
     * @param colIdxs: the indices of data columns to select
     * @return An n-column dataframe
     */
    public static Dataframe generate(Integer[] colIdxs) {
        return generate(colIdxs, false, "");
    }

    /**
     * Generate an n-column numeric dataframe from the precomputed matrix, with an optional text column added as the last column
     * 
     * @param colIdxs: the indices of data columns to select
     * @param addString: whether or not to add the text column
     * @return An n-column dataframe, with an optional text column
     */
    public static Dataframe generate(Integer[] colIdxs, boolean addString) {
        return generate(colIdxs, addString, "");
    }

    /**
     * Generate an n-column numeric dataframe from the precomputed matrix, with an optional text column added as the last column
     * 
     * @param colIdxs: the indices of data columns to select
     * @param addString: whether or not to add the text column
     * @param colPrefix: the desired prefix name for the text column, will be colPrefix+"text"
     * @return An n-column dataframe, with an optional text column of name colPrefix+"text"
     */
    public static Dataframe generate(Integer[] colIdxs, boolean addString, String colPrefix) {
        List<PredictionInput> ps = new ArrayList<>();
        for (int i = 0; i < data[0].length; i++) {
            List<Feature> fs = new ArrayList<>();
            AtomicInteger colName = new AtomicInteger(0);
            for (int colIdx : colIdxs) {
                fs.add(FeatureFactory.newNumericalFeature(colPrefix + colName.getAndIncrement(), data[colIdx][i]));
            }
            if (addString) {
                fs.add(FeatureFactory.newTextFeature(colPrefix + "text", "text"));
            }
            ps.add(new PredictionInput(fs));
        }
        return Dataframe.createFromInputs(ps);
    }
